                    /* #undef GET_SHAPE */
                    struct dcp_task_cfg cfg = dcp_task_cfg(task);
                    /* printf("[_(%d, %d, %d, %d, %d)] = %.10f,\n", profid, seqid, j, cfg.hmmer3_compat, cfg.multiple_hits, */
